import React, { Component } from "react";
import Title from "./Title"
import ScraperText from "../Data/ScraperText"

class Scraper extends React.Component{
    render () {
        return (
            <div>
                <Title text="Web Scraper"></Title>
                <div className="Body">
                    <div className="introduction">
                        <h2>Motivation</h2>
                        <p>{ScraperText["introduction"]}</p>
                    </div>

                    <div>
                        <p>A link to the github repository showing this code can be found 
                            <a href={ScraperText["link"]}
                                target="_blank"> here</a> 
                        </p>
                    </div>

                    <div className="intuition"></div>

                </div>
            </div>
        )
    }
}

export default Scraper
